import React from 'react';
import {Row, Col, Button ,Avatar, Typography} from 'antd'
import styled from 'styled-components';

const WapperUserInfo = styled.div`
    display: flex;
    justify-content : space-between;
    padding : 15px 15px;
    
    .username{
        color: white;
        padding-left: 5px;
    }
`;
function UserInfo() {
    return (
        <WapperUserInfo>
                <div>
                    <Avatar>P</Avatar>
                    <Typography.Text className="username">Nguyễn Văn Phú</Typography.Text>
                </div>
                <Button gosh >Đăng Xuất</Button>
        </WapperUserInfo>
    );
}

export default UserInfo;
